import "./NavbarStyles.css";
import {Link} from 'react-router-dom'
import React from "react";

function Navbar() {
  return (
    <nav className="NavbarItems">
      <h1 className="navbar-logo"> TRIPPY</h1>

      <ul className="nav-menu">
        <li>
          <Link to='/'><i class="fa-solid fa-house-user"></i>Home</Link>
        </li>
         <li className="nav-links">
          <Link to='/about'><i class="fa-solid fa-circle-info"></i>About</Link>
        </li> 
        <li className="nav-links">
        <Link to='/service'><i class="fa-solid fa-circle-info"></i>Service</Link>
      </li> <li className="nav-links">
      <Link to='/contact'><i class="fa-solid fa-circle-info"></i>Contact</Link>
    </li> 
      </ul>
    </nav>
  );
}

export default Navbar;
